import React from 'react'


class Art extends React.Component {
  constructor() {
    super()
    this.state = {
      tags: ["art", "code"],
      projects: [
        {
          name: "Collages",
          tags: ["art"]
        },
        {
          name: "Make it Neat!",
          tags: ["code", "hci", "game"]
        }

      ]
    }
  }

  componentDidMount() {
  }

  componentWillUnmount() {
  }

	render() {
    return (
  		<div>
        {this.state.tags.map((tag, i) => {
            return(
            <button key={`${tag}`}>
              {tag}
            </button>
            )
          })}

        {this.state.projects.map((project, i) => {
            return (
              <div key={`${project.name}`}>
                {project.name}
              </div>
            )
        })}
  		</div>
    )
	}
}


export default Art;
